import React, { Component} from 'react';
import  InputRange  from './InputSlider';

class noValueSlider extends Component {

    render() {
        return (
            <form className="form">  
                <div className="row">
                    <div className="col-md-2">
                        <p>Enable</p>
                    </div>
                    <div className="col-md-7">
                        <div className="flex-div">
                            <InputRange value={50} min={0} max={100} onChange={event => this.setState({ defaultValue: event.target.defaultValue })}/> 
                        </div>
                    </div>
                </div>
            </form>
        );
    }
}


export default noValueSlider;
